import React, { useState } from "react";

const StaffSalary = function () {
  const [staffData, setStaffData] = useState([
    {
      name: "OB1CHAM",
      rank: "Модератор",
      mainSalary: 150,
      asnwerForum: 3,
      online: 75600,
      additionallyOnline: 7200,
      bonus: 200,
      totalWeek: 455,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
  ]);
  return (
    <div>
      <table>
        <tr>
          <td>Никнейм модератора</td>
          <td>Должность на сервере</td>
          <td>Основная зарплата</td>
          <td>Ответы на форуме</td>
          <td>Отыгранный онлайн</td>
          <td>Дополнительный онлайн</td>
          <td>Дополнительный бонус</td>
          <td>Итог за неделю</td>
          <td>Общий итог</td>
          <td>День рождения</td>
        </tr>
        <tr>
          {staffData.map((player) => {
            return (
              <>
                <td>{player["name"]}</td>
                <td>{player["rank"]}</td>
                <td>{player["mainSalary"]}</td>
                <td>{player["asnwerForum"]}</td>
                <td>{player["online"]}</td>
                <td>{player["additionallyOnline"]}</td>
                <td>{player["bonus"]}</td>
                <td>{player["totalWeek"]}</td>
                <td>{player["totalAllTime"]}</td>
                <td>{player["birthday"]}</td>
              </>
            );
          })}
        </tr>
      </table>
      <h1>Зпшка</h1>
    </div>
  );
};

export default StaffSalary;
